(1, 1, 'html_and_head', '<!DOCTYPE html>\n<!-- paulirish.com/2008/conditional-stylesheets-vs-css-hacks-answer-neither/ -->\n<!--[if lt IE 7]> <html class="no-js lt-ie9 lt-ie8 lt-ie7" lang="en"> <![endif]-->\n<!--[if IE 7]>    <html class="no-js lt-ie9 lt-ie8" lang="en"> <![endif]-->\n<!--[if IE 8]>    <html class="no-js lt-ie9" lang="en"> <![endif]-->\n<!-- Consider adding a manifest.appcache: h5bp.com/d/Offline -->\n<!--[if gt IE 8]><!--> <html class="no-js" lang="en"> <!--<![endif]-->\n\n<head>\n  <meta charset="utf-8">\n<meta name="sitelock-site-verification" content="3212" />\n<!-- <meta http-equiv="X-UA-Compatible" content="IE=9; IE=8; IE=7; IE=EDGE" /> -->\n  <title>Occupational Therapy Competencies Australia</title>\n  <meta name="description" content="">\n\n  <!-- Mobile viewport optimized: h5bp.com/viewport -->\n  <meta name="viewport" content="width=device-width">\n\n  <!-- Place favicon.ico and apple-touch-icon.png in the root directory: mathiasbynens.be/notes/touch-icons -->\n  <link rel="shortcut icon" type="image/x-icon" href="/favicon.ico"/>\n  <link rel="stylesheet" href="/css/style.css">\n  <link href=''/css/ot-style2.css'' rel=''stylesheet''>	\n\n<link rel="stylesheet" media="screen" href="/css/superfish.css" /> \n<link rel="stylesheet" media="screen" href="/css/superfish-vertical.css" /> \n\n\n<!--[if lte IE 8]>\n	<link rel="stylesheet" href="/css/ltie8-style.css">\n<![endif]-->\n<!--[if gt IE 8]>\n	<link rel="stylesheet" href="/css/gtie8-style.css">\n<![endif]-->\n<!-- script src="/js/libs/modernizr-2.5.3.min.js"></script -->\n\n'),
(2, 1, 'body_start', '<body>\n  <!-- Prompt IE 6 users to install Chrome Frame. Remove this if you support IE 6.\n       chromium.org/developers/how-tos/chrome-frame-getting-started -->\n  <!--[if lt IE 7]><p class=chromeframe>Your browser is <em>ancient!</em> <a href="http://browsehappy.com/">Upgrade to a different browser</a> or <a href="http://www.google.com/chromeframe/?redirect=true">install Google Chrome Frame</a> to experience this site.</p><![endif]-->\n<!--[if lte IE 8]>\n<script>\n	document.createElement(''footer'');\n	document.createElement(''header'');\n</script>\n<![endif]-->'),
(3, 1, 'login_header', '  <header>\n<div id="login">\n<div style="float:left; margin-right:1em">\n {if logged_out}\n                       <a href="{path=''/member/login''}">Log In</a>   <a href=''{path=''/member/register''}''>Register</a>\n                {/if}\n{if logged_in}\n                		                     Hello, {screen_name}.\n{/if}                 \n</div>\n<div style="float:left">\n{if logged_in}\n  <a href=''{path=''/member/profile''}''>Edit your settings</a>\n <a href="{path=''logout''}">Logout</a>\n  {/if}                     \n                	</div>\n</div>\n  </header>'),
(5, 1, 'navigation_menu', '<div id=''menu''>\n\n\n<div id=''site-heading''><strong>occupational therapy competencies australia</strong></div>\n{if logged_in}\n<div id="traffic-light-set">\n<div  id="emerging">&raquo;</div>\n<div  id="consolidating">&raquo;</div>\n<div  id="competent">&raquo;</div>\n                       </div>\n{/if}\n<br clear=''all''>\n<div id="search">\n                <br>\n                <input type="text" name="keywords" id="keywords" value="" size="18" maxlength="100"><br>\n                <input type="submit" class="submit" value="Search">\n</div>\n\n		<ul class=''sf-menu''>\n		\n			<li>	\n			{becoming-competent-link}\n{ie-sensitive-ul}\n<li>{your-practice-placement-link}</li>\n<li><a href=''/practice-placement/set-your-learning-objectives''>Set Your Learning Objectives</a></li>\n<li><a href=''/practice-placement/resources-to-develop-your-competencies''>Resources to Develop Your Competencies</a></li>\n<li><a href=''/practice-placement/self-assess-your-competencies''>Self-Assess Your Competencies</a></li>\n<li><a href=''/practice-placement/evidence-your-competencies''>Evidence Your Competencies</a></li>\n<li><a href=''/practice-placement/summary-of-your-competencies''>Your ePortfolio: A Summary of Your Competencies</a></li>\n<li><a href=''/practice-placement/reflect-on-this-practice-cycle''>Reflect on this Practice Placement Cycle</a></li>\n</ul>\n</li>\n<li>			\n			{practice-contexts-link}\n			</li>			\n<li>\n				{being-a-professional-link}\n{ie-sensitive-ul}\n<li>{practice-reasoning-link}</li>\n<li>{reflection-link}</li>\n<!-- <li>{personal-growth-link}</li> -->\n</ul>\n			</li>\n			<li>\n				{ot-practice-process-link}\n			</li>\n<li>\n{practice-resources-link}\n{ie-sensitive-ul}\n                                <li><a href=''/practice-resources/request-for-service''>1 - Request for Service</a></li>\n                                 <li><a href=''/practice-resources/information-gathering''>2 - Information Gathering</a></li>\n   <li><a href=''/practice-resources/occupational-assessment''>3 - Occupational Assessment</a></li>\n   <li><a href=''/practice-resources/identification-of-occupational-issues''>4 -Identification of Occupational Issues</a></li>\n   <li><a href=''/practice-resources/goal-setting''>5 - Goal Setting</a></li>\n   <li><a href=''/practice-resources/intervention''>6 - Intervention</a></li>\n   <li><a href=''/practice-resources/evaluation''>7 - Evaluation</a></li>\n  <li><a href=''/practice-resources/being-a-professional''>Being a Professional</a></li></ul>\n</li>\n<li>{evidencing-link}\n\n{ie-sensitive-ul}\n<!-- <li><a href=''/practice-reasoning/types-of-evidence''''>Levels of Evidence &amp; Types of Evidence</a> -->\n<li><a href=''/practice-resources/being-a-professional''>Holistic Evidence Examples</a></li>\n<li>\n<!-- {evidencing-matrix-link} -->\n<li>{if logged_in}<a href=''/pages/diary''>Reflective Diary</a>\n{if:else}\n<p style=''color: rgb(66,66,66); padding: 0.75em 1em;''>Reflective Diary (available to registered users)</p>\n{/if}\n</li>\n\n<!-- <li><a href=''''>Developing yourself</a></li> -->\n</ul>\n</li>\n<li>\n<a href=''/workshops/workshop-questionnaires''>Workshop Questionnaires</a>\n</li>\n\n		</ul>\n\n<!-- <div id=''message_side''>\n   <p style=''color: red''>This website is in beta testing stage.\n     </p>\n  <p>Please report any issues to the <a href=''mailto:webmaster@otca.net.au''>webmaster</a>\n     with a detailed description.\n</p>\n</div>-->\n		</div>');
