(6, 1, 'uni_logos', '<footer>\n        <a href=''http://www.olt.gov.au''><img src=''/img/OLT_cobrand_200px.jpg'' alt=''Australian Government & Office of Learning and Teaching Logo''/></a>\n	<a href=''http://www.newcastle.edu.au''><img src=''/img/UoN-logo.png'' alt=''University of Newcastle Logo''/></a>\n	<a href=''http://www.uws.edu.au''><img src=''/img/uws-logo.png'' alt=''University of Western Sydney Logo'' /></a>\n	<a href=''http://www.latrobe.edu.au''><img src=''/img/latrobe-logo.jpg''  alt=''Latrobe University Logo''/></a>\n	<a href=''http://www.csu.edu.au''><img src=''/img/csturt-logo.png''  alt=''Charles Sturt University Logo''/></a>\n	<a href=''http://www.jcu.edu.au''><img src=''/img/jcook-logo.png''  alt=''James Cook University Logo''/></a>\n        \n<div id="contact">\n<!-- obsfucated to avoid some spam bots -->\n\n<p>\n	 	For general enquiries please contact:  <a href="mailto:enquiries@otca.net.au">enquiries@otca.net.au</a></p>\n	</div><br clear=''both''>\n<p style=''font-size: 8px''>Support for the production of this website has been provided by the Australian Government Office for Learning and Teaching. The views expressed in this website do not necessarily reflect the views of the Australian Government Office for Learning and Teaching.</p>\n<p style="font-size: 8px">Unless otherwise noted, content on this site is licensed under the Creative Commons Attribution 3.0 Australia licence<a href="http://creativecommons.org/licenses/by-sa/3.0/au/"><img src="/img/by-sa.png" style="float: right; margin-right: 565px;width: 100px" alt="CC Attribution Share-Alike Copyleft Logo"></a><br>\nInformation on the creative commons licence can be found at: <a href=''http://creativecommons.org.au/licences''>http://creativecommons.org.au/licences</a></p> \n\n  </footer>'),
(7, 1, 'js_analytics', '<script type="text/javascript">\n\n  var _gaq = _gaq || [];\n  _gaq.push([''_setAccount'', ''UA-39621357-1'']);\n  _gaq.push([''_trackPageview'']);\n\n  (function() {\n    var ga = document.createElement(''script''); ga.type = ''text/javascript''; ga.async = true;\n    ga.src = (''https:'' == document.location.protocol ? ''https://ssl'' : ''http://www'') + ''.google-analytics.com/ga.js'';\n    var s = document.getElementsByTagName(''script'')[0]; s.parentNode.insertBefore(ga, s);\n  })();\n\n</script>'),
(8, 1, 'js', '  <!-- JavaScript at the bottom for fast page loading -->\n\n  <!-- Grab Google CDN''s jQuery, with a protocol relative URL; fall back to local if offline -->\n <script src="//ajax.googleapis.com/ajax/libs/jquery/1.8.2/jquery.min.js"></script>\n  <script>window.jQuery || document.write(''<script src="js/libs/jquery-1.7.1.min.js"><\\/script>'')</script>\n<!-- <script src="/js/flowbanner.js"></script> -->\n<script src="/js/libs/jquery.hoverIntent.minified.js"></script> \n{embed=''/structure/criteria-loader-jq-plugin'' }\n<script src=''/js/jquery.livequery.js''></script>\n<script src="/js/libs/superfish.js"></script>\n<script src=''/js/libs/jquery.tubeplayer.min.js''></script>\n<script src=''/js/libs/jquery.youtubequiz.js''></script>\n<script src=''/js/jquery.asmselect.js''></script>\n{embed=''structure/core_javascript''}');
INSERT INTO `exp_snippets` (`snippet_id`, `site_id`, `snippet_name`, `snippet_contents`) VALUES
(9, 1, 'js_ot_evidence', '  <!-- JavaScript at the bottom for fast page loading -->\n\n  <!-- Grab Google CDN''s jQuery, with a protocol relative URL; fall back to local if offline -->\n  <script src="//ajax.googleapis.com/ajax/libs/jquery/1.8.2/jquery.min.js"></script>\n  <script>window.jQuery || document.write(''<script src="js/libs/jquery-1.7.1.min.js"><\\/script>'')</script>\n  \n<script src="/js/libs/jquery.hoverIntent.minified.js"></script> \n<script src="/js/libs/superfish.js"></script>\n<script src=''/js/jquery.OTevidencing.js''></script>\n<script src="/js/libs/jquery.form.js" type="text/javascript"></script>\n<script src=''/js/criteria-loader.js''></script>\n\n                <script type="text/javascript">\n                        $(document).ready(function(){\n           window.userProfile = { };\n	window.emptyUserProfile = {\n			"cycleStartDate" : new Date(),\n			"reflections" : [],\n			"startNewCycle" : false,\n			"steps" : [],\n			"level" : 0,\n			"beginner" : true,\n                        "objectives" : []\n	};\n        \n        window.stepDefinitions = [ "null", "Request for Service", "Information Gathering", "Occupational Assessment", "Identification of Occupational Issues", "Goal Setting", "Intervention",\n                                              "Evaluation"  ];\n       	\n	if(localStorage.userProfile == undefined) { \n		window.userProfile = emptyUserProfile;\n	} else {\n		window.userProfile = JSON.parse(localStorage.userProfile);\n        }\n	\n	if(userProfile.startNewCycle) {\n			localStorage.clear();\n			userProfile = emptyUserProfile;\n	}\n\n                  $("ul.sf-menu").superfish({ \n            animation: {height:''show''},   // slide-down effect without fade-in \n            delay:     1200               // 1.2 second delay on mouseout \n        }); \n         if (''{if logged_in}'' == ''{if TRUE}'') {\n                localStorage.clear();\n                $("#traffic-light-set").criteriaLoader(); \n                $(''.evidencing-app'').evidencing();\n         }\n      });\n</script>'),
(10, 1, 'ajax_loader', '<div class=''ajax-loader''>Please wait, loading...</div>'),
(11, 1, 'competency_levels', '<span class="emerging" style="padding: 5px;">\n            Emerging\n        </span>\n     <span class="consolidating" style="padding: 5px;">\n        Consolidating\n        </span>\n    <span class="competent" style="padding: 5px;">\n        Competent to Graduate\n        </span>\n'),
(13, 1, 'cycle-toolbar', '{if group_id == 1 || group_id == 6 || group_id == 7}\n<div id=''for-educators''>\n<a href=''/pages/educator-students''>For Educators</a>\n</div>\n{/if}\n{if group_id == 1 || group_id == 5}\n<div class="cycle-toolbar">\n<div class="panel">Your Toolbar</div>\n<ul>\n<li><a id="save" title="Archive your current practice cycle and start a new cycle.">New Practice Placement Cycle</a></li>\n<li><a id="restore" title="Restore or delete a previous practice cycle.">Manage Practice Placement Cycles</a></li>\n<li><a href=''https://otca.net.au/member/memberlist''>Nominate your Educators</a></li>\n<li><a id="contract" title="View your learning contract." href=''/pages/learning-contract/''>Your Learning Contract</a></li>\n<li><a id="upload" title="Tick competency statements you have achieved on the OTCEM and upload any supporting evidence." href="/pages/assessed-matrix/add_evidence/">Self-Assess Your OTCEM</a></li>\n<li><a id="upload" title="View your progress on the OTCEM." href="/pages/assessed-matrix/overview">Cumulative Overview of Your OTCEM (Read only)</a></li>\n<li><a id="history" title="View existing evidence and diary entries." href=''/practice-placement/summary-of-your-competencies''>Your ePortfolio</a></li>\n<li><a id="diary" title="View your private diary" href=''/pages/diary''>Your Diary</a>\n<li><a id="diary" title="View the progress you have made on the PRACSOT" href=''/pracsot''>Your PRACSOT Progress</a>\n\n</ul>\n</div>\n{/if}\n'),
(15, 1, 'cycle-name-box', '{if group_id == 1 || group_id == 5}\n<div class=''cycle-name-box''>\n&nbsp;&nbsp;&nbsp;<strong title=''You start a new Practice Placement Cycle for each placement.''>Your Current Practice Placement Cycle Name is: </strong>\n</div>\n{/if}'),
